import React , { Component } from 'react';
import PropTypes from 'prop-types';

class Header extends Component {
  constructor(props) {
    super(props);
    this.counter = {
        count: 0
    };
}
static defaultProps = {
  jump: 1
};

static propTypes = {
  jump: PropTypes.number
};
  incrementCount = () => {
    this.setCounter( { count: this.counter.count });
};
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-5 offset-md-5" >
            <div className="page-header">
            <h1>MMDL</h1>
              <h2>Dart Player Draft List <span className="badge"> {this.props.incrementCount}</span></h2>
            </div>
          </div>
        </div>
      </div>  
    ) ;
  }
}

export default Header;
